import React from "react";

const InputForm = (props) => {
  return (
    <div>
      <div className="row">
        <input
          placeholder="Product"
          id="product-input"
          // onChange={handleProductChange}
          type="text"
          label="product"
        ></input>
        <label htmlFor="price-input"></label>
        <input
          placeholder="Price"
          id="price-input"
          // onChange={handleProductChange}
          type="text"
          label="price"
        ></input>
        <label htmlFor="description-input"></label>
        <input
          placeholder="Description"
          id="description-input"
          // onChange={handleProductChange}
          type="text"
          label="description"
        ></input>
        <button type="submit">Submit</button>
      </div>
      <br></br>
    </div>
  );
};

export default InputForm;
